	style={{backgroundColor:`hsl(${num}, 100%, 70%)`,height:`${num}%`}}
	>
	<span className={classes.csnum}>{num}%  </span>
   </div>

   <div className={classes.studentName}>
     Haria Panda
   </div>

</div>
);
}

